INSERT INTO `abouts` VALUES (1,'BLP Property','<p>Sejak berdiri pada tahun 1981, BLP Property terus bergerak dan terus berkembang untuk membangun Kawasan perumahan mandiri, yang menjadi salah satu icon di Gresik. Menyadari bahwa hunian sangatlah penting untuk tempat tinggal dengan aktifitas sehari-hari. BLP Property mengembangkan Kawasan Perumahan yang dilengkapi sarana prasarana public, seperti :<br><br>1. Sarana Perbelanjaan (Super Market, Mall, Pasar tradisional Modern, Pertokoan dll)<br>2. Sarana Pendidikan (Paud, TK, SD, SMP, SMA hingga Universitas)<br>3. Sarana Bisnis (Perkantoran &amp; Perbankkan)<br>4. Sarana Kesehatan (Klinik, Puskesmas Hingga Rumah Sakit)<br>5. ATM Center<br>6. Sarana Wisata<br>7. Hotel Berbintang<br>8. Dan sarana prasarana lainnya untuk menunjang kebutuhan sehari2<br><br>Progress pembangunan yang masif dan kontinu di lapangan. Hal ini adalah bentuk bukti keseriusan dan komitmen BLP Property sebagai Pelopor Kawasan Perumahan Mandiri di kota Gresik hingga saat ini.</p><p>Dalam mengembangkan suatu proyek, BLP Property selalu berupaya memberikan pelayanan terbaik dan nilai tambah yang maksimal. Berorientasi kepada kebutuhan dan kepentingan konsumen inilah yang membuat BLP Property menjadi Brand yang mendapatkan kepercayaan yang tinggi dari konsumennya selama hapir 40 tahun. Hal ini jugalah yang menjadi landasan komitmen yang akan selalu diusung oleh BLP Property sebagai dasar dibangun untuk kehidupan yang lebih baik<br><br>Pada tahun 2019 ini BLP Property membuka Kawasan Mandiri Baru di Gresik bagian Barat yaitu Gresik Kota Raya (GKR) dengan luas lahan +/- 130Ha, dengan Klaster awal (Pesona Raya) pada pertengahan bulan Oktober 2019.<br><br>Tidak lupa Kawasan Mandiri kami yg sedang dalam proses perkembangan yakni Pondok Permata Suci (PPS) dengan luas +/- 120 Ha. Juga membuka Regency2 Baru. Kawasan yang berdiri pada awal tahun 2000an ini, sudah banyak dihuni warga yang telah menetap di PPS, lebih dari 10.000 warga.<br><br>Kawasan Gresik Kota Baru (GKB)&nbsp; saat ini menjadi icon kota gresik</p><p>Tercatat sudah lebih dari 10.000 Unit rumah yang telah kami bangun. Dalam kurun waktu hamper 40 tahun,1 hingga 2 bulan kedepan akan mulai menyusul proses pembangunan 50 Unit rumah di tahap kedua, yang berarti pada akhir semester I 2016 nanti sekitar 100 Unit lebih akan siap diserah terimakan kepada konsumen dan siap digunakan beserta fasilitas pendukungnya.</p><p>Disamping pembangunan unit rumah, pembangunan infrastruktur jalan dan saluran, infrastruktur jaringan listrik dan air bersih, Gerbang Utama kawasan, dan ruang ruang terbuka hijau. ini dilakukan semata-mata demi kepuasan dan kenyamanan konsumen ketika mulai menghuni perumahan dari BLP Property dengan fasilitas terbaik dan Berfungsi secara optimal.</p><p>Tak kalah menariknya, dikawasan Perumahan BLP Property juga akan membangun Sarana Edukasi WORLDPARK (Taman Dunia) di area PPS, sarana ini akan menjadi elemen penting untuk mendukung kenyaman tinggal di kawasan perumahan PPS Gresik. Berbagai icon dunia akan dihadirkan dalam konsep pembangunan Worldpark, Mulai dari Torri Gate (japan), Menara Eiffel (Paris),&nbsp; Menara Pisa (Itali), Big Ben (London) dan Colosseum (Roma) dilengkapi dengan taman dan lain-lain.</p><p><strong>Investasi menguntungkan</strong> BLP Property Gresik adalah pilihan terbaik untuk hunian berkualitas. Dengan perkembangannya, Fasilitas lengkap dan terbaik, lokasi yang sangat strategis, dan dikembangkan dan dikelola oleh pengembang terpercaya yang berpengalaman. Dan memiliki rumah di BLP Property Gresik tidak hanya nyaman untuk ditinggali, tetapi juga menjadi investasi masa depan yang sangat menjanjikan.</p>',NULL,'2024-04-16 11:15:00','2024-04-16 11:15:00');
