INSERT INTO `categories` VALUES (1,'Permata Natura',NULL,'2024-03-26 14:05:00','2024-04-16 09:10:11','[]','[]','[]','complete','permata-natura'),(2,'Permata Sportivo',NULL,'2024-03-26 14:05:00','2024-04-16 09:10:19','[]','[]','[]','complete','permata-sportivo'),(3,'Permata Orchard ','<h1><u>Tentang Permata Orchard Residence</u></h1>\nPermata Orchard Residence berada di area ekslusif “Orchard Boulevard” di dalam kawasan mandiri Pondok Permata SUci (PPS) Gresik. Memiliki konsep dengan desain rumah mewah 2 lantai yang menggunakan material berkualitas di lingkungan yang nyaman.\n\nLokasi sangat strategis dengan akses jalan kembar yang mudah menjangkau berbagai fasilitas seperti: Sarana Pendidikan, Sarana Ibadah, Fasilitas Kesehatan, Pasar Tradisional Modern, Pusat Perbelanjaan, Pusat Kuliner, ATM Center, Taman, dan sebagainya.\n\nPerkembangan kawasan mandiri PPS yang terus bertumbuh adalah investasi masa depan karena fasilitas baru dan nilai investasi yang terus meningkat.\n\nSegera putuskan untuk membeli rumah di PERMATA ORCHARD RESIDENCE untuk kehidupan amsa depan Anda dan Keluarga.','2024-03-26 14:05:00','2024-04-16 09:56:17','[\"01HVJ9DX6BMDEZE6F63HJ18KNZ.jpg\"]','[\"01HVJ9DX6DN02STZ2SBVTK4C11.jpg\", \"01HVJ9DX6E49HJNR4NFKX81RZQ.jpg\"]','[{\"title\": \"Siteplan\", \"images\": [\"01HVJ9DX6FQQ4C4T0N2EM7YEQM.jpg\", \"01HVJ9DX6FQQ4C4T0N2EM7YEQN.jpg\"], \"description\": \" Tipe 72/119 (2 lantai)\"}, {\"title\": \"Gallery\", \"images\": [\"01HVJ9G291ZQDFKKSGGSX792HC.jpg\", \"01HVJ9G292G05YFWRRZT718E9D.jpg\"], \"description\": null}]','progress','permata-orchard'),(4,'Permata Discovery',NULL,'2024-03-26 14:05:00','2024-04-16 09:10:29','[]','[]','[]','progress','permata-discovery');
